const batchSize = 10;
const result = [];

for (let i = 0; i < items.length; i += batchSize) {
  const batch = items.slice(i, i + batchSize).map(item => ({
    keyword: item.json.keyword,
    avg_monthly_searches: item.json.avg_monthly_searches,
    competition_value: item.json.competition_value,
    low_cpc: item.json.low_cpc,
    high_cpc: item.json.high_cpc,
    geo: item.json.geo
  }));

  result.push({ json: { batch } });
}

return result;

return items.flatMap(({ json, index }) => {
  let output = json.output;

  // Remove code block formatting like ```json or ``` (if present)
  output = output
    .replace(/^```json\n?/, '')   // strip opening fence
    .replace(/```$/, '')          // strip closing fence
    .replace(/\)\s*$/gm, '');     // remove stray ')' at end of a line

  // Try parsing the cleaned JSON string
  let parsed;
  try {
    parsed = JSON.parse(output);
  } catch (e) {
    throw new Error("Invalid JSON format in output: " +  e.message);
  }

  // Return each keyword item as a separate n8n item
  return parsed.map(keywordItem => ({ json: keywordItem,"pairedItem": index}));
});

return items.filter(item => {
  const data = item.json;

  // Check: is it empty?
  const isEmpty = Object.keys(data).length === 0;

  // Optional: also remove items where all values are null, "", or undefined
  const isAllValuesEmpty = Object.values(data).every(v => v === null || v === '' || v === undefined);

  return !isEmpty && !isAllValuesEmpty;
});
